import React,{Component} from 'react';
import '../pages/HomePage/homePage.less';

class Header extends Component{
  constructor(props){
    super(props);
    this.state={};
  }
  
  render(){
    return(
      <React.Fragment>
        <div className="header">
          <div className="header-container">
              内容部分
          </div>
        </div>
      </React.Fragment>
    )
  }
}

export default Header;
